При запуске программы на экран сначала выводится объявленная коллекция фигур. Затем демонстрируется результат поворота/отражения некоторых фигур как подготовка к их использованию. Далее фигуры перемещаются и образуют заданную картинку. Для рисования использованы прямоугольники, линии и точки. Физиономия является пользовательской фигурой.

tickets/25.html.body:
Вопрос 25: Множественное наследование. Множественное вхождение базового класса. Разрешение неоднозначности.
Один класс может наследовать атрибуты двух и более классов одновременно. Для этого использу­ется список базовых классов, в котором каждый из базовых классов отделен от других запятой. Общая форма множественного наследования имеет вид:
class ИмяПорожденногоКласса: список базовых классов
{
...
};

Для доступа к членам порожденного класса, унаследованного от нескольких базовых классов, используются те же правила, что и при порождении из одного базового класса. Проблемы могут возникнуть в следующих случаях:

если в порожденном классе используется член с таким же именем, как в одном из базовых классов;

когда в нескольких базовых классах определены члены с одинаковыми именами.
В этих случаях необходимо использовать оператор разрешения контекста для уточнения элемента, к которому осуществляется доступ, именем базового класса.
Пример
class A : public B {
            // B используется для связывания всех
            // задач в список (список диспетчера)

            // ...
         };

         class C : public B {
            // link используется для связывания всех
            // изображаемых объектов (список изображений)

            // ...
         };
class D : public A, public C {
            // ...
         };

Естественно, у двух базовых классов могут быть функции-члены с одинаковыми именами:

         class A {
            // ...
            virtual info* inf();
         };

         class C {
            // ...
            virtual info* inf();
         };
При использовании класса D подобная неоднозначность функций должна быть разрешена:

         void f(D* sp)
         {
         info* dip = sp->inf(); //ошибка: неоднозначность
         dip = sp->A::inf();       // нормально
         dip = sp->C::inf();  // нормально
         }
Однако, явное разрешение неоднозначности хлопотно, поэтому для ее устранения лучше всего определить новую функцию в производном классе:

         class D : public A, public derived {
            // ...
            debug_info* get_debug()
            {
              debug_info* dip1 = task:get_debug();
              debug_info* dip2 = displayed::get_debug();
              return dip1->merge(dip2);
            }
         };



class X
{int key;};
class Y
{int key;};
class Z
{int key;};
class A : public X, public Y, public Z
{int key;
...............
key=X :: key + Y :: key + Z :: key;
...............
};

Так как объект порожденного класса состоит из нескольких частей, унаследованных от базовых классов, то конструктор порожденного класса должен обеспечивать инициализацию всех наследуемых частей. В списке инициализации в заголовке конструктора порожденного класса должны быть перечислены конструкторы всех базовых классов. Порядок выполнения конструкторов при порождении из нескольких классов следующий:

конструкторы базовых классов в порядке их задания;

конструкторы членов, являющихся объектами класса;

конструктор порожденного класса.


Деструкторы вызываются в порядке обратном вызову конструкторов.
Пример:
#include 
using namespace std;
class X {
protected:
  int key;
public:
  X (int i=0) {cout 
Результат:
X constructor
Y constructor
Z constructor
object.key = 18
Z destroyed

Y destroyed

X destroyed

tickets/26.html.body:
Вопрос 26: Закрытое наследование и его альтернатива - включение.
От того, с каким спецификатором доступа объявляется наследование базового класса, зависит статус доступа к членам производного класса. 
Общая форма наследования классов имеет следующий вид:
class имя_класса: доступ имя_класса {....};

Здесь доступ определяет, каким способом наследуется базовый класс. Закрытое наследование - это когда спецификатор доступа принимает значение private, при этом все публичные и защищенные члены базового класса становятся частными членами производного класса.
ДЛЯ СПРАВКИ:Спецификатор доступа может принимать три значения — private, public и protected. В случае, если спецификатор доступ опущен, то по умолчанию подразумевается на его месте спецификатор private. Если спецификатор доступ принимает значение public, то все публичные и защищенные члены базового класса становятся соответственно публичными и защищенными членами производного класса.  Если спецификатор доступ принимает значение protected, то все публичные и защищенные члены базового класса становятся защищенными членами производного класса.
Закрытое наследование означает реализацию посредством - т.е. от базового класса необходимо взять какую-то функциональность, базовый класс и потомок не имеют како-либо концептуальной связи.Закрытое наследование не носит характера отношения подтипов.Закрытое (также как и защищенное) наследование не создает иерархии типов.
ПРИМЕР
#include 
class X {
protected: int i;
}
class Y: private X {...};// i  преобразовано к частному члену Y
class Z: public Y {public:void f();};
//поскольку i является частным для Y, оно не может наследоваться в Z (не создается иерархии объектов)
void Z::f(){ i = 2;}//  данная функция не работает т.к. i не доступна

Агрегация или включение – это когда членом одного класса становится объект другого:
Пример использования включения:
Пусть класс D имеет член класса B.
class D
{
public:
  B b;
  ...
};

В свою очередь класс B имеет член класса C.
class В
{
public:
  С с;
  ...
};

Таким образом, используя включение мы строим иерархию объектов.
С точки зрения проектирования закрытое наследование равносильно включению, если не считать вопроса с замещением функци
В общем случае между включением и наследованием(не закрытым) есть принципиальная разница:
Включение — это отношение has a (имеет).Используя включение мы строим иерархию объектов.
Наследование — это отношение is a (является). Используя наследование (не закрытое), мы сторим иерархию классов.
Пример (для понимания):
автомобиль имеет руль, колеса и т.д. и т.п.
И автомобиль является транспортным средством.
Есть несколько сценариев, когда стоит применять закрытое наследование вместо включения:

Необходимо переопределение абстрактных и/или виртуальных методов.

Необходимо использовать экземпляр наследника полиморфным образом в ограниченном окружении (например, в дружественной функции). Но в общем смысле отношение ЯВЛЯЕТСЯ между наследником и базовым классом отсутствует.

При закрытом наследовании, наследник может обращаться к защищенным членом базового класса.

Закрытое наследование позволяет реализовать "сужающее" наследование. Когда наследник содержит лишь несколько методов базового класса (путем поднятия види-мости с помощью using Base::ProtectedMethod).


Если все это нужно, то закрытое наследование будет более предпочтительнее включения.
Пример:
class  A
{
public: void  PublicFoo()  {}
        virtual  void  VirtualPublicFoo() {}
protected: void  ProtectedFoo()  {}
private: void  PrivateFoo()  {}
};

class  B  :  private  A
{
friend  void CrazyPolymorphicMethod(const  A*  a);
public: using  A::ProtectedFoo;
        void  Foo(){ //  Поднимаем  видимость  одного из  методов  базового  класса
                    ProtectedFoo();//  Вызываем  закрытый  метод!
                    CrazyPolymorphicMethod(this);//  Пример  ограниченного полиморфизма
                     }
private: virtual  void  VirtualPublicFoo()
          override{/*  Переопределяем  виртуальный метод!*/}
};

void  CrazyPolymorphicMethod(const  A* a)
{/**/}

tickets/27.html.body:
Вопрос 27: Виртуальные базовые классы
Когда два или более класса порождаются от одного общего базового класса, можно предот­вратить включение нескольких копий базового класса в объект-потомок этих классов путем объяв­ления базового класса виртуальным при его наследовании.
ПРИМЕР
#include 

class base {
      public: int i; 
};
// d1 наследует base как virtual
class d1 : virtual public base { 
    public: int j; 
};
// d2 наследует base как virtual
class d2 : virtual public base { 
    public:int k;
};
// d3 наследует как d1 так и d2. Тем не менее в d3 имеется только одна копия base! 
class d3 : public d1, public d2 {
    public: int m;
}; 
int main(){ 
    d3 d;
    d.i = 10; // неопределенности нет
}

Как видно, ключевое слово virtual предшествует спецификации наследуемого класса. Оба класса d1 и d2 наследуют класс base как виртуальный. Любое множественное наследование с их участием порождает теперь включение только одной копии класса base. Поэтому в классе d3
имеется только одна копия класса base, и, следовательно, d.i = 10 не является двусмыслен­ным выражением.
Необходимо иметь в виду еще одно обстоятельство: хотя оба класса d1 и d2 используют класс base как виртуальный, тем не менее всякий объект класса d1 или d2 будет содержать в себе base. Например, следующий код абсолютно корректен:
// определение класса типа d1
d1 myclass;
myclass.i = 100;

Обычные и виртуальные базовые классы отличаются друг от друга только тогда, когда какой- либо объект наследует базовый класс более одного раза. При использовании виртуального базового класса только одна копия базового класса содержится в объекте. В случае использования обычного базового класса в объекте могут содержаться несколько копий.

tickets/28.html.body:
Вопрос 28:Контроль доступа к членам базовых классов. Защищённые члены.
Базовый класс - это класс, который наследуется (является родителем).
Член класса может быть:
• частным (private); это значит, что его имя можно использовать только в методах класса и в друзьях - классах(не путать дружбу с наследованием!), в котором он описан;
•  защищенным (protected); это значит, что его имя можно использовать только в функциях-членах и друзьях класса, в котором он описан, а также в функциях-членах и друзьях классов, являющихся производными по отношению к этому классу;
• общим (public); это значит, что его имя можно использовать в любой функции.
Члены класса, описанного со служебным словом class, являются частными по определению. Члены класса, описанного со служебным словом struct или union, являются общими по определению, например:
class X { int x;};//x частный по определению

struct S { int s;};// s общий по определению

class B{

    public: int c;// c общий 

    private: int a;// a частный

    protected: int b; //b защищенный

};

ПРИМЕР
class some {

    friend void f(some&);

public:

    int a_;

protected:

    int b_;

private:

    int c_;

};

void f(some& obj) {

    obj.a_ = 0; // OK

    obj.b_ = 0; // OK

    obj.c_ = 0; // OK

}

void g(some& obj) {

    obj.a_ = 0; // OK

    obj.b_ = 0; // compile time error

    obj.c_ = 0; // compile time error

}

class derived : public some {

    derived() {

        a_ = 0; // OK

        b_ = 0; // OK

        c_ = 0; // compile time error

    }

};

ДАЛЬШЕ ВСЯ ИНФОРМАЦИЯ ДЛЯ СПРАВКИ(в билет писать не надо, а знать, наверное, надо): 
С помощью ключевого слова friend можно обозначить так называемый дружественный класс или функцию. Такая функция (или класс) имеет доступ ко всем нестатическим полям и методам класса в котором находится через параметр-объект класса, которому она дружественна.Дружба не наследуется, не передается и не даруется:

Допустим, класс Bicycle - друг класса Cycle. Тогда все потомки Bicycle не будут друзьями Cycle.
Если класс Bicycle - друг класса Cycle, а Cycle - друг класса Auto, то Bicycle не будет другом Auto.
Дружба односторонняя: Bicycle - друг Cycle, но Cycle не друг Bicycle.

ПРИМЕР ИСПОЛЬЗОВАНИЯ ДРУЖБЫ
class X { 

private:

    int n;
    friend void friend_function(X**** p, int i);

public:

    void member_function(int i);

};

void friend_function(X* p,  int i) { p->n = i; }

// Функция не является членом класса, поэтому X:: не пишем.

// Поскольку дружественная функция не является членом класса, она не получает указатель this

// и ей необходимо явно передавать объект, с которым она будет работать. 

void X::member_function(int i) { n = i; } 

void f() {
    X obj;
    friend_function(&obj, 10); // Функции вызываются по-разному,
    obj.member_function(10);// но приводят к одному и тому же результату 
}

tickets/30.html.body:
Обобщённые классы
Любой шаблон начинается со слова template, будь то шаблон функции или шаблон класса. После  ключевого слова template идут угловые скобки — , в которых перечисляется список параметров шаблона. Каждому параметру должно предшествовать зарезервированное слово class или typename. Отсутствие этих ключевых слов будет расцениваться компилятором как синтаксическая ошибка. Некоторые примеры объявления шаблонов:
template 

